import React from "react";
import { Card, Col, Table, Pagination, Row} from "react-bootstrap";
import Header from "../Components/Header";
import inboxicon from '../Assets/images/icon/inbox-color.svg';

import Sidebars from "../Components/Sidebar";

export default function Supportmessage() {
  return (
    <>
      <Header />
      <div className="d-flex">
        <div className="col-2">
          <Sidebars className="w-100" />
        </div>

        <div className="Homepage-maincontainer col-10 px-5 py-2">
          <h2 className="fw-bold">Support Messages</h2>

         <Row>
         <Col xl={4}>
            <Card className="my-4 p-4">
              <div className="d-flex justify-content-between">
                <div className="d-flex">
                    <img src={inboxicon} />
                    <h5 className="m-0 ps-2">Inbox</h5>
                </div>
                <span></span>
              </div>
            </Card>

          </Col>
         </Row>
        </div>
      </div>
    </>
  );
}
